import React from 'react';
import ContactItem from '../Components/ContactItem';

import phone from '../img/phone.png';
import location from '../img/location.png';
import email from '../img/email.png';

function ContactPage() {
    return (
        <div className="ContactPage">
            <div className="map-sect"></div>
            <div className="contact-sect">
                <ContactItem icon={phone} text1={'+1 512.417.3703'} text2={'+1 512.508.9282'} title={'Phone'} />
                <ContactItem icon={location} text1={'+1 512.417.3703'} text2={'+1 512.508.9282'} title={'Address'} />
                <ContactItem icon={email} text1={'+1 512.417.3703'} text2={'+1 512.508.9282'} title={'Email'} />
            </div>

        </div>

    )
}

export default ContactPage;
